static void unittest_binstr_one_int(int n, char *expected, int *current, int total)
{
	int ret;
	char *out = NULL;
	size_t out_len;

	*current += 1;
	ret = ft_to_binstr((uint8_t *)&n, 4, &out, &out_len);
	assert(ret == 0);
	assert(!strcmp(out, expected));
	free(out);
	out = NULL;
	STATUS(*current, total);
}

static void unittest_binstr_one_str(char *str, char *expected, int *current, int total)
{
	int ret;
	char *out = NULL;
	size_t out_len;

	*current += 1;
	ret = ft_to_binstr((uint8_t *)str, strlen(str), &out, &out_len);
	assert(ret == 0);
	assert(!strcmp(out, expected));
	free(out);
	out = NULL;
	STATUS(*current, total);
}

